COPY test_logic_quality_rules.lc_destinacioneconomicatipo (t_id, thisclass, baseclass, itfcode, ilicode, seq, inactive, dispname, description) FROM stdin;
97	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	0	Acuicola	\N	f	Acuicola	Se califica con destino acuícola, aquellos predios donde se realizan cultivos de organismos acuáticos, en ambientes naturales o artificiales.
98	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	1	Agricola	\N	f	Agrícola	Se califica con destino agrícola, aquellos predios con funcionalidad de laboreo agrícola, terrenos que han sido transformados y ocupados para la producción de cultivos cuyo objetivo es satisfacer las necesidades alimentarias, comerciales y agrícolas.\n\nEn caso de encontrar actividad agrícola y actividad pecuaria en un mismo predio, se califica según la actividad que predomine. Si, ambas actividades tienen el mismo porcentaje de participación en el predio, se debe calificar como agrícola.
99	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	2	Agroindustrial	\N	f	Agroindustrial	Se califica con destino agroindustrial, aquellos predios destinados a la actividad que implica cultivo (producción) y transformación (industrialización y comercialización) de productos agrícola, pecuario y forestal.
100	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	3	Agroforestal	\N	f	Agroforestal	Se califica con destino agroforestal, aquellos predios destinados al establecimiento y aprovechamiento combinado de especies forestales con actividades agrícolas o pecuarias con arreglos diferenciados. Incluye la actividad agrosilvícola, silvopastoril y agrosilvopastoril.
101	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	4	Comercial	\N	f	Comercial	Se califica con destino comercial, aquellos predios cuya finalidad es la de realizar la actividad económica de ofrecer, transar o almacenar bienes y/o servicios a través de un mercader o comerciante.
102	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	5	Cultural	\N	f	Cultural	Se califica con destino cultural, aquellos predios considerados como bienes culturales de la nación, además los espacios destinados al desarrollo de actividades artísticas.
103	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	6	Educativo	\N	f	Educativo	Se califica con destino educativo, aquellos predios donde se desarrollan actividades académicas, tanto de la educación inicial, preescolar, básica, media y superior. Incluye los jardines, escuelas, colegios, institutos técnicos, fundaciones educativas, centros de investigación y universidades.
104	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	7	Forestal	\N	f	Forestal	Se califica con destino forestal, aquellos predios con áreas naturales o seminaturales, constituidas principalmente por elementos arbóreos de especies nativas, exóticas e introducidas.  Incluye las plantaciones forestales comerciales y los bosques naturales y seminaturales.
105	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	8	Habitacional	\N	f	Habitacional	Se califica con destino habitacional, aquellos predios de uso residencial cuya finalidad es la vivienda habitual de las personas. Incluye los parqueaderos, garajes y depósitos dentro de propiedad horizontal como también los predios rurales de vivienda campestre.
106	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	9	Industrial	\N	f	Industrial	Se califica con destino industrial, aquellos predios donde se desarrollan actividades de producción, fabricación, preparación, recuperación, reproducción, ensamblaje, construcción, transformación, tratamiento y manipulación de materias primas para producir bienes o productos materiales y que no estén clasificados dentro de los predios mineros.
107	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	10	Infraestructura_Asociada_Produccion_Agropecuaria	\N	f	Infraestructura asociada a producción agropecuaria	Se califica con destino infraestructura asociada a la producción agropecuaria, aquellos predios sobre los cuales se encuentra la infraestructura requerida dentro de la actividad agropecuaria y que son de interés para el sector agropecuario, como: bancos de maquinaria, plantas de almacenamiento, centros de acopio, centros de transformación agrícola, mataderos, etc.
108	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	11	Infraestructura_Hidraulica	\N	f	Infraestructura hidráulica	Se califica con destino infraestructura hidráulica, aquellos predios sobre los cuales se encuentra establecida infraestructura para controlar, almacenar y conducir un flujo continuo de agua. Incluye los embalses, represas, acueductos, centrales de tratamiento y distribución, alcantarillados, estaciones depuradoras de aguas residenciales y distrito de adecuación de tierras.
109	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	12	Infraestructura_Saneamiento_Basico	\N	f	Infraestructura saneamiento	Se califica con destino infraestructura de saneamiento básico, aquellos predios sobre los cuales se encuentra establecida la infraestructura para el saneamiento básico, con excepción del alcantarillado. Incluye los centros de acopio de basura y material reciclable, rellenos sanitarios e incineradoras.
110	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	13	Infraestructura_Seguridad	\N	f	Infraestructura seguridad	Se califica con destino infraestructura de seguridad, aquellos predios sobre los cuales se encuentra establecida infraestructura destina a salvaguardar el orden público. Incluye las estaciones de policía, batallones, cárceles, etc.
111	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	14	Infraestructura_Transporte	\N	f	Infraestructura transporte	Se califica con destino infraestructura de transporte, aquellos predios en los cuales se encuentra establecida infraestructura para el desarrollo de actividad de transporte, muelles para embarque, desembarque de carga y/o pasajeros, pistas de aterrizaje, torres de control, centros de almacenamiento y venta de combustible, etc. Se exceptúan de estas, aquellas plataformas flotantes y aquellas que se encuentren fuera de la plataforma continental.
112	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	15	Institucional	\N	f	Institucional	Se califica con destino institucional, aquellos predios destinados a la administración y prestación de servicios del Estado tanto de orden nacional como territorial.
113	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	16	Mineria_Hidrocarburos	\N	f	Minería hidrocarburos	Se califica con destino minería e hidrocarburos, aquellos predios donde se hace aprovechamiento directo de los recursos minerales o transformación primaria de los mismos.
114	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	17	Lote_Urbanizable_No_Urbanizado	\N	f	Lote urbanizable no urbanizado	Se califica con este destino, aquellos predios urbanos no construidos, ubicados en terrenos de grandes áreas que no han sido desarrollados y sin restricción legal para adelantar algún tipo de desarrollo urbanístico.
115	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	18	Lote_Urbanizado_No_Construido	\N	f	Lote urbanizado no construido	Se califica con este destino, aquellos predios urbanos no construidos, ubicados en zonas urbanizadas, es decir, con infraestructura de servicios públicos e infraestructura vial.
116	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	19	Lote_No_Urbanizable	\N	f	Lote no urbanizable	Se califica con este destino, aquellos predios urbanos o rurales clasificados por el instrumento de planeación como suelo de protección, también se incluyen los predios con afectación, por ejemplo los utilizados como servidumbres para los servicios públicos.
117	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	20	Pecuario	\N	f	Pecuario	Se califica con destino pecuario, aquellos predios destinados a la cría, beneficio y aprovechamiento de especies de animales no domésticos, para el consumo humano (productos cárnicos y lácteos), uso artesanal (lana, cuero, plumas, etc.) y conservación de fauna (zoocría).
118	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	21	Recreacional	\N	f	Recreacional	Se califica con destino recreacional, aquellos predios que corresponden a equipamientos deportivos y recreativos, parques de propiedad privada o pública, clubes, generando bienestar físico y social.
119	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	22	Religioso	\N	f	Religioso	Se califica con destino religioso, aquellos predios cuya finalidad es el culto religioso público, incluye las parroquias, basílicas, catedrales, santuarios, capillas, colegiatas, monasterios, conventos y seminarios.
120	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo	\N	23	Salubridad	\N	f	Salubridad	Se califica con destino salubridad, aquellos predios destinados al cuidado de la salud de los ciudadanos, incluye los hospitales, centros de salud, clínicas, laboratorios y consultorios que prestan el servicio de salud tanto carácter público o privado
