252	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo	\N	1	Rrom	\N	f	Rrom	El pueblo Rrom o gitano se consolida y fortalece como grupo étnico que hacer parte de la diversidad étnica y cultural de la nación colombiana. Su origen se remonta a más de 1000 años, proviene del norte de la India y conserva un alto bagaje cultural que lo diferencia de otros pueblos y de la sociedad mayoritaria. En este sentido, cuenta con unos elementos identitarios que los diferencian notablemente de los demás grupos étnicos de la sociedad. Sé es Rrom o gitano por derecho de nacimiento y se lleva la sangre gitana.
253	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo	\N	2	Raizal	\N	f	Raizal	Es la población nativa de las Islas de San Andrés, Providencia Y Santa Catalina descendientes de la unión entre europeos (principalmente ingleses, españoles y holandeses) y esclavos africanos. Se distinguen por su cultura, lengua (creole), creencias religiosas (iglesia bautista) y pasado histórico similar a los pueblos antillanos como Jamaica y Haití.
254	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo	\N	3	Palenquero	\N	f	Palenquero	La comunidad palenquera está conformada por los descendientes de los esclavizados que mediante actos de resistencia y de libertad, se refugiaron en los territorios de la Costa Norte de Colombia desde el Siglo XV denominados palenques. Existen 4 Palenques reconocidos: San Basilio de Palenque (Mahates – Bolívar), San José de Uré (Córdoba), Jacobo Pérez escobar (Magdalena) y La Libertad (Sucre).
255	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo	\N	4	Negro_Afrocolombiano	\N	f	Negro o afrocolombiano	Es el conjunto de familias de ascendencia afrocolombiana que poseen una cultura propia, comparten una historia y tienen sus propias tradiciones y costumbres dentro de la relación campo-poblado, además revelan y conservan conciencia de identidad que las distinguen de otros grupos étnicos. Se suele denominar a este grupo humano como negros, morenos, mulatos y afrodescendientes.
256	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo	\N	5	Ninguno	\N	f	Ninguno	No pertenece a ningún grupo étnico.
